  `status` tinyint(1) NULL DEFAULT 0 COMMENT '状态 0未确认 1已确认',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `create_admin_id` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '制单人ID',
  `create_admin_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '制单人姓名',
  `confirm_admin_id` int(10) UNSIGNED NULL DEFAULT 0 COMMENT '确认人ID',
  `confirm_admin_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '确认人姓名',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `order_code`(`order_code`) USING BTREE,
  INDEX `create_time`(`create_time`) USING BTREE,
  INDEX `store_id`(`store_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '进销存' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for dayi_stock_detail
-- ----------------------------
DROP TABLE IF EXISTS `dayi_stock_detail`;
CREATE TABLE `dayi_stock_detail`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
