  `drug_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '药品名称',
  `package_spec` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '规格',
  `dispense_unit` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '库存单位',
  `retail_price` mediumint(8) UNSIGNED NULL DEFAULT NULL COMMENT '零售价（分）',
  `manufactor_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '厂家',
  `origin_place` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '原产地',
  `amount` mediumint(8) NULL DEFAULT NULL COMMENT '出入库数量 入库+ 出库-',
  `purchase_price` mediumint(8) UNSIGNED NULL DEFAULT NULL COMMENT '进货价（分）',
  `batch_number` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '批号',
  `valid_time` datetime(0) NULL DEFAULT NULL COMMENT '有效期',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `stock_id`(`stock_id`) USING BTREE,
  INDEX `drug_id`(`drug_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '进销存详情' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for dayi_store
-- ----------------------------
DROP TABLE IF EXISTS `dayi_store`;
CREATE TABLE `dayi_store`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `adcode` mediumint(5) UNSIGNED NULL DEFAULT NULL COMMENT '城市编码',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '诊所名称',
  `image_facade` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '门面照',
  `image_area` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '候诊区域照片',
  `image_department` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '医技科室照片',
  `image_other` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '其他照片',
  `location` varchar(25) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '经纬度坐标',
  `geohash` char(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '经纬度geo码',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地址',
  `tel` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '联系手机',
  `fixed_tel` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '固定电话号码',
  `business_hours` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '营业时间',
  `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '简介',
  `is_chain` tinyint(1) NULL DEFAULT 0 COMMENT '是否连锁店 0否 1是',
  `time_interval` tinyint(3) UNSIGNED NULL DEFAULT 20 COMMENT '排班时段 (分钟) ',
  `time_amount` mediumint(3) UNSIGNED NULL DEFAULT 2 COMMENT '排班时段最大下单量',
  `time_day` mediumint(8) UNSIGNED NULL DEFAULT NULL COMMENT '排班工作日 (星期1-7)',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `sort` mediumint(8) UNSIGNED NULL DEFAULT 0 COMMENT '排序 从大到小',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '状态 0禁用 1正常营业 2建设中',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '诊所门店' ROW_FORMAT = Dynamic;

