CREATE TABLE `pro_ratelimit`  (
  `skey` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '唯一key',
  `min_num` mediumint(8) UNSIGNED NULL DEFAULT NULL COMMENT '分钟访问次数',
