-- ----------------------------
-- Table structure for pro_version
-- ----------------------------
DROP TABLE IF EXISTS `pro_version`;
CREATE TABLE `pro_version`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `os` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '系统平台（ios|android|qt）',
  `install_mode` tinyint(1) NULL DEFAULT NULL COMMENT '安装方式（1整包升级2应用资源升级）',
  `upgrade_mode` tinyint(1) NULL DEFAULT NULL COMMENT '升级方式（1询问2强制3静默）',
  `version` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '版本号',
  `note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '版本描述',
  `url` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '下载地址',
